    category: "society",
    votesInteresting: 11,
    votesMindblowing: 2,
    votesFalse: 0,
    createdIn: 2019,
  },
  {
    id: 3,
    text: "Lisbon is the capital of Portugal",
    source: "https://en.wikipedia.org/wiki/Lisbon",
    category: "society",
    votesInteresting: 8,
    votesMindblowing: 3,
    votesFalse: 1,
    createdIn: 2015,
  },
];



function App() {
  return (
    <>
      <Header />
      <NewFactForm />
      <main className='main'>
        <CategoryFilters />
        <FactList />

      </main>
    </>
  )
}

export default App
